import React from 'react';
import './App.css';
import FilteredList from './FilteredList'
import 'bootstrap/dist/css/bootstrap.min.css';

const productList = [

  { name: "Nasa", topic: "biology", year: "2020" },
  { name: "Metal", topic: "design", year: "2019" },
  { name: "Coralogy", topic: "psychology", year: "2019" },
  { name: "Tilly", topic: "biology", year: "2019" },
  { name: "Block", topic: "design", year: "2018" },
  { name: "Coffee", topic: "design", year: "2020" },
  { name: "Mouse", topic: "design", year: "2020" },
  { name: "Responsive", topic: "psychology", year: "2020" },
  { name: "Iterative", topic: "design", year: "2020" },
  { name: "AB", topic: "design", year: "2020" },
  { name: "Personas", topic: "psychology", year: "2020" },
  ];


export default class App extends React.Component {
  constructor(props){
    super(props);
  }

  render() {
    return (
      <div>
		    <FilteredList list={productList} />
	    </div>

    )
  }
}
